var title_f3_10_3239="Transjugular intrahepatic portosystemic shunt";
var content_f3_10_3239=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F72311&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F72311&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 547px\">",
"   <div class=\"ttl\">",
"    Transjugular intrahepatic portosystemic shunt",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 527px; height: 664px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A transjugular intrahepatic portosystemic shunt (TIPS) is created by passing a needle catheter via the transjugular route into the hepatic vein and wedging it there. The needle is then extruded and advanced through the liver parenchyma to the intrahepatic portion of the portal vein and a stent is placed between the portal and hepatic veins. A TIPS functions like side-to-side surgical portacaval shunt, but does not require general anesthesia or major surgery for placement. (A) Passage of a guidewire between the hepatic vein and the portal vein. (B) Inflation of a balloon catheter within the liver to dilate the tract between the hepatic vein and the portal vein. (C) Deployment of the stent. (D) Stent in its final position.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
